import React from "react";

function HorizontalnaLista(props)
{
    <Style 
        scopeSelector="li"
        rules={{
            paddingLeft:20
        }}
        />
    return(
        <ul>
            <li>{props.prvi}</li>
            <li>{props.drugi}</li>
            <li>{props.treci}</li>
            <li>{props.cetvrti}</li>
        </ul>
    );
}

export default HorizontalnaLista;
